import { Container, Button } from '@mui/material'
import { styled } from '@mui/material/styles';
import { Link } from "react-router-dom";

const StyledContainer = styled(Container)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center'
}))

const Landing = () => {
  return (
    <StyledContainer>
      <p className='text-5xl font-bold my-2'>Slogan</p>
      <p className='text-xl my-2'>description</p>
      <div className='bg-green-500 w-[300px] h-[300px] my-2'></div>
      <p className='text-9xl font-bold'>1,234,456</p>
      <Link to={'/sign-in'}>
        <Button variant='contained' size='large' sx={{marginTop: 5}}>Go</Button>
      </Link>
    </StyledContainer>
  )
}

export default Landing
